<html>
  <head>
    <title>Make Your Own Blotch Logo</title>
  </head>
  <body>
    <div id="mainContainer">
      <h2>Fill Version</h2>
      <a href="/"><strong>(Change to Stroke Version)</strong></a>
      <form>
        <p>
          Scatter
          <input type="range" name="scatter" id="scatter" min="0.0" max="30.0" value="8.0" step="0.5">
        </p>
        <p>
          Radius Minimum
          <input type="range" name="radminimum" id="radminimum" min="0.0" max="18.0" value="0.25" step="0.05">
        </p>
        <p>
          Radius Maximum
          <input type="range" name="radmaximum" id="radmaximum" min="0.0" max="18.0" value="2.0" step="0.05">
        </p>
        <p>
          Speed
          <input type="range" name="speedvalue" id="speedvalue" min="100" max="5000" value="3100" step="50">
        </p>
        <p>
          Change Color
          <input type="checkbox" name="colorRand" id="colorRand">
        </p>
      </form>
      <p>
        <a href="/2">Reset</a>
        <span> | </span>
        <a id="pauseAnim" href="#">Pause</a>
        <span> | </span>
        <a id="playAnim" href="#">Play</a>
      </p>
    </div>
